import styles from './Card.module.scss';
import clsx from 'clsx';

const Card = props => {
  return (
    <ul>
      <li className={styles.card}>{props.title}
        < Button className={clsx("fa fa-star-o", props.isFavourite === true && styles.active)} /></li>
    </ul>
  );
};

export default Card;
